import React from 'react';
import Task from './Task';

const TaskList = (props) => {

  const tasks = props.tasks.map(task => (
    <Task
      key={task.id}
      text={task.text}
    />
  ))
  return (
    <div>
      <h2>Tasks To Do</h2>
      {tasks}
      <hr />
      <h3>Done Tasks (0)</h3>
    </div>
  );
}

export default TaskList;
